import React, { Component, PropTypes } from 'react'
import { Grid, Menu, Segment } from 'semantic-ui-react'
import { connect } from 'react-redux'
import { selectMeal, fetchPostsIfNeeded } from '../actions'
import MenuList from '../components/MenuList'
import Posts from '../components/Posts'

import styles from './style.css';

class App extends Component {
    constructor(){
        super();
        this.state={
            menu: [{
                name: "meat",
                description: "Meat description",
                image: "data:image/jpeg;base64,"
                },{
                name: "pasta",
                description: "Pasta description",
                image: "data:image/jpeg;base64,"
                },{
                name: "fish",
                description: "Fish description",
                image: "data:image/jpeg;base64,"
                },{
                name: "sandwich",
                description: "Sandwich description",
                image: "data:image/jpeg;base64,"
                }
            ]
        }
    }
    static propTypes = {
       
        selectedMeal: PropTypes.string.isRequired,
        posts: PropTypes.array.isRequired,
        isFetching: PropTypes.bool.isRequired,
        dispatch: PropTypes.func.isRequired
    }

    componentDidMount() {
        const { dispatch, selectedMeal } = this.props
        console.log("1", this.props)
        dispatch(fetchPostsIfNeeded(selectedMeal))
    }

    componentWillReceiveProps(nextProps) {
        if (nextProps.selectedMeal !== this.props.selectedMeal) {
            const { dispatch, selectedMeal } = nextProps
            console.log("2", nextProps)
            dispatch(fetchPostsIfNeeded(selectedMeal))
        }
        
    }


    handleClick = nextMeal =>{
        console.log("33>", nextMeal)

        this.props.dispatch(selectMeal(nextMeal))
    }
    
    

    render() {
        const {  selectedMeal, posts, isFetching } = this.props
        const { menu } = this.state
        console.log("currentMenu",menu)
        const isEmpty = posts.length === 0
        console.log("5", this.props)
        return (
        <div>
            <Grid relaxed columns={2}> 
                
                <Grid.Column width={4}>
                    
                     <img src="http://lorempixel.com/500/200/food/" alt='food' className='width-cover'/>
                   
                    <Menu fluid vertical tabular>
                    
                {
                    menu.map(
                        link => 
                        
                            <MenuList key={link.name} name={link.name} descr={link.description} img={link.image} onClick={this.handleClick} value={link.name}/>
                        )
                    }
                    </Menu>
        
                    
                </Grid.Column>
                <Grid.Column stretched width={12}>
                    
                    <Segment>
                        <h2>{selectedMeal}</h2>
                        {
                            isEmpty    ? (isFetching ? <h2>Loading...</h2> : <h2>Empty.</h2>)
                                    : <div style={{ opacity: isFetching ? 0.5 : 1 }}>
                                        <Posts posts={posts} />
                                    </div>
                        }
                    </Segment>
                </Grid.Column>
                
            </Grid>
            
          
        </div>
        )
    }


}

const mapStateToProps = state => {
    const { selectedMeal, postsByMeal } = state
    const {
        isFetching,
        items: posts
    } = postsByMeal[selectedMeal] || {
        isFetching: true,
        items: []
    }

    return {
        selectedMeal,
        posts,
        isFetching
       
    }
}

export default connect(mapStateToProps)(App)